  false,\n\t\"url\": null,\n\t\"notes\": \"Data consists of Acoustic Doppler Current
  Profiles recorded in NODC'S F004 format. The data were collected using an Ametek-Straza
  instrument aboard the R/V CAPE FLORIDA, cruise no. CF-8405 in May 1984. These data
  were collected by the University of Miami in the Gulf of Mexico and its part of
  years 1 and 2 of SAIC'S Mineral Management Service (MMS) sponsored Gulf of Mexico
  Physical Oceanography Program. This program was funded under MMS contract number
  14-12-0001-29158. The data were recorded in ASCII format and submitted by Dr. Evans
  Waddell.nnThe F004 format is used for data from measurements and analyses of physical
  and chemical characteristics of the water column. Among chemical parameters that
  may be recorded are salinity, PH, and concentration of oxygen, ammonia, nitrate,
  phosphate, chlorophyll, and suspended solids. Physical parameters that may be recorded
  include temperature, density (sigma-t), transmissivity, and current velocity (east-west
  and north-south components). Cruise and station information, including environmental
  conditions of the study site at the time of observations, is also included.\",\n\t\"owner_org\":
